import React from "react";
import { NavLink } from "react-router-dom";

function Nav({ dogs }) {
    return (
        <nav>
            <NavLink to="/dogs">
                Home
            </NavLink>
            {dogs.map(d => (
                <NavLink to={`/dogs/${d.name.toLowerCase()}`} key={d.name}>
                    {d.name}
                </NavLink>
            ))}
        </nav>
    ); 
}

export default Nav;
